import React from "react";
import Filter from "../components/Filter";
import Movie_List from "../components/Movie_List";
import { useMovieContext } from "../context/movie_context";

// TODO:
// 1. FLITER COMPONENT
// 2. DIVIDER + SORT
// 3. GRIDVIEW + LISTVIEW
// REFERENCE: https://developers.themoviedb.org/3/discover/movie-discover

export const Movies_Page = () => {
  const {
    fetchGenre,
    fetchCertifications,
    fetchFilter,
    genres,
    certifications,
  } = useMovieContext();
  console.log(fetchFilter);
  return (
    <>
      <Filter
        genres={genres}
        fetchGenre={fetchGenre}
        fetchCertifications={fetchCertifications}
        certifications={certifications}
        fetchFilter={fetchFilter}
      />
      <Movie_List />
    </>
  );
};

export default Movies_Page;
